import React from 'react'
import './App.css'
import 'bootstrap/dist/css/bootstrap.min.css'
import Navbar from './components/Navbar.'
import Header from './components/Header'
import Sobre from './components/Sobre'


function App() {
  return (
    <div>
      <Navbar />
      <Header />
      <Sobre/>
    </div>
  )
}

export default App;
